import styled from "styled-components"

export const Container = styled.div` 
    width: 700px;
    height: 600px;
    border: 1px solid red;
    overflow: hidden;

`

export const SliderContainer = styled.div` 

    width: 100000000px;
    height: 600px;
    border: 1px solid red;
    overflow: hidden;
    display: flex;
    margin-left: -600px;



`

export const NewPetContainer = styled.a`

    width: 700px;
    height: 600px;

`
